import React from 'react';
import styled from 'styled-components';

export default function Header({ name, dob, stats}) {
    return (
        <HeaderContainer>
            <Image />
            <TitleContainer>
                <Title>{name}</Title>
            </TitleContainer>
        </HeaderContainer>
    )
}

const HeaderContainer = styled.div`
    height: 50%;
    width: 100%;
    position: relative;
`

const Image = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
`
const TitleContainer = styled.div`
    position: absolute;
    bottom: 0;
    left: -40%;
`

const Title = styled.h1`
    text-align: center;
    width: 60%;
    font-size: 2em;
`
